T_JBV('6872950','4302209XH6140S0001DY'),
T_JBV('6872744','4302209XH6140S0001DY')
	); 
	V_TMP_JBV T_JBV;
    
BEGIN	
	
	DBMS_OUTPUT.PUT_LINE('[INICIO] ');

	 
    -- LOOP para actualizar los valores en ECO_EXPEDIENTE_COMERCIAL -----------------------------------------------------------------
    DBMS_OUTPUT.PUT_LINE('[INFO]: UPDATE REFERENCIA CATASTRAL ACTIVOS');
   FOR I IN V_JBV.FIRST .. V_JBV.LAST
	
	LOOP
 
	V_TMP_JBV := V_JBV(I);

  	NUM_ACT := TRIM(V_TMP_JBV(1));
  	
  	REF_CAT := TRIM(V_TMP_JBV(2));

	V_SQL := 'SELECT COUNT(1) FROM '||V_ESQUEMA||'.ACT_ACTIVO WHERE ACT_NUM_ACTIVO = '||NUM_ACT||'';
				
        EXECUTE IMMEDIATE V_SQL INTO V_NUM_TABLAS;
        
        --Si existe realizamos otra comprobacion
        IF V_NUM_TABLAS > 0 THEN		

		--Comprobamos el dato a insertar
		V_SQL := 'SELECT ACT_ID FROM '||V_ESQUEMA||'.ACT_ACTIVO WHERE ACT_NUM_ACTIVO = '||NUM_ACT||'';
				
		EXECUTE IMMEDIATE V_SQL INTO ACT_ID;
		
		V_SQL := 'SELECT COUNT(1) FROM '||V_ESQUEMA||'.ACT_CAT_CATASTRO WHERE ACT_ID = '||ACT_ID||'';
				
		EXECUTE IMMEDIATE V_SQL INTO V_NUM_TABLAS_2;
		
		--Si existe realizamos otra comprobacion
		IF V_NUM_TABLAS_2 > 0 THEN

			V_MSQL := 'UPDATE '||V_ESQUEMA||'.ACT_CAT_CATASTRO SET CAT_REF_CATASTRAL = '''||REF_CAT||'''
							, USUARIOMODIFICAR = '''||V_USUARIO||'''
							, FECHAMODIFICAR = SYSDATE
					WHERE ACT_ID = '||ACT_ID||'';
						
			EXECUTE IMMEDIATE V_MSQL;
			
			DBMS_OUTPUT.PUT_LINE('[INFO]: ACTUALIZADO CORRECTAMENTE LA REFERENCIA CATASTRAL DEL ACTIVO '||NUM_ACT||'');

			V_COUNT_UPDATE := V_COUNT_UPDATE + 1;
			
			--El activo no existe
		ELSE
				 
			V_MSQL :='INSERT INTO '||V_ESQUEMA||'.ACT_CAT_CATASTRO
			( CAT_ID, ACT_ID, CAT_REF_CATASTRAL, USUARIOCREAR, FECHACREAR, BORRADO )
			VALUES
			( S_ACT_CAT_CATASTRO.NEXTVAL, '||ACT_ID||', '''||REF_CAT||''', '''||V_USUARIO||''', SYSDATE, 0 )';
						
			EXECUTE IMMEDIATE V_MSQL;
			
			DBMS_OUTPUT.PUT_LINE('[INFO]: INSERTADA CORRECTAMENTE LA REFERENCIA CATASTRAL DEL ACTIVO '||NUM_ACT||'');

			V_COUNT_INSERT := V_COUNT_INSERT + 1;

		END IF;					
		
	--El activo no existe
	ELSE
		DBMS_OUTPUT.PUT_LINE('[INFO]: EL ACTIVO '||NUM_ACT||' NO EXISTE ');
	END IF;
		
    END LOOP;
    COMMIT;
   
	DBMS_OUTPUT.PUT_LINE('********************************************************************');

	DBMS_OUTPUT.PUT_LINE('[FIN] Se han updateado en total '||V_COUNT_UPDATE||' registros ');

	DBMS_OUTPUT.PUT_LINE('********************************************************************');

	DBMS_OUTPUT.PUT_LINE('[FIN] Se han insertado en total '||V_COUNT_INSERT||' registros ');

	DBMS_OUTPUT.PUT_LINE('********************************************************************');

EXCEPTION

   WHEN OTHERS THEN
        err_num := SQLCODE;
        err_msg := SQLERRM;

        DBMS_OUTPUT.put_line('[ERROR] Se ha producido un error en la ejecución:'||TO_CHAR(err_num));
        DBMS_OUTPUT.put_line('-----------------------------------------------------------'); 
        DBMS_OUTPUT.put_line(err_msg);

        ROLLBACK;
        RAISE;          

END;

/

EXIT
